(22, 'Guia Espiritual', 'Nenhum', 'Suporte', 0, 'VocÃª possui um guia espiritual que entra\nem contato com vocÃª por sonhos. Este guia pode\nassumir qualquer forma, mas normalmente escolhe a\nforma de um animal. Ele irÃ¡ lhe alertar se alguma coisa\nacontecer enquanto vocÃª estiver dormindo, e pode\n(quando o mestre achar necessÃ¡rio) alertar sobre algum\nperigo iminente ou uma mensagem do futuro.\nVocÃª pode usar o guia espiritual para relembrar de fatos\npassados da sua vida, ou saber informaÃ§Ãµes sobre animais e\nplantas. Para isto, basta meditar por alguns minutos.', 0),
(23, 'Medicina Natural', 'Nenhum', 'Suporte', 0, 'VocÃª pode rolar 3d6 quando fizer testes\nde InteligÃªncia para fazer curativos, e conhecer ervas\nmedicinais. Este teste pode prevenir que um aliado\ncontraia veneno ou doenÃ§as comuns.', 0),
