(25, 'Sabedoria Selvagem', 'Nenhum', 'Suporte', 0, 'VocÃª pode rolar 3d6 quando fizer testes\nde InteligÃªncia referentes a conhecimentos de plantas,\nanimais e natureza.', 0),
