(30, 'Chuva de Flechas 2', 'NÃ­vel 5; Chuva de Flechas', 'AÃ§Ã£o', 10, 'VocÃª pode atirar varias flechas em um\nsÃ³ ataque. Para cada flecha extra, gaste 10 pontos de\nmana. VocÃª pode escolher alvos diferentes para cada\nflecha extra. MÃ¡ximo 6 flechas por ataque e vocÃª pode\nescolher mÃºltiplos alvos.\nExemplo: Para fazer um ataque com 3 flechas, gaste\n20 pontos de mana.', 0),
