(32, 'Companheiro Animal 4', 'NÃ­vel 5; Companheiro Animal 3', 'Suporte', 0, 'Seu companheiro animal ganharÃ¡ +10\nde Vida e Mana, e +1 em trÃªs atributos a sua escolha.', 0),
(33, 'Flecha Elemental 2', 'NÃ­vel 5; Flecha Elemental', 'AÃ§Ã£o', 20, 'VocÃª pode encantar uma flecha com\num poder. Este encantamento dura 1 rodada. Qualquer\nalvo atingido por ela recebe um dano adicional de +16\nde fogo, frio ou elÃ©trico (a sua escolha). ', 0),
(34, 'Flecha Fantasma 2', 'NÃ­vel 5; Flecha Fantasma', 'AÃ§Ã£o', 20, 'VocÃª pode encantar uma flecha com um poder.Este encantamento dura 1 rodada. Esta flecha\natinge alvos incorpÃ³reos e ignora paredes, portas,\narmaduras, escudos e qualquer coisa nÃ£o seja orgÃ¢nica\nou sobrenatural. Causa +12 de dano adicional.', 0),
(35, 'Herbalismo', 'NÃ­vel 5; Medicina Natural', 'Suporte', 0, ' VocÃª sabe fazer muitas coisas com ervas\nraras. Se ficar um dia inteiro procurando estas ervas em\numa floresta, vocÃª Ã© capaz de encontrar uma delas (se\nelas existirem nesta floresta; consulte o mestre).\nEncontrando a Erva da Lua e a Folha de Garraka,\nvocÃª pode fazer uma pasta verde e aplicar em uma arma\nou flecha. Ao atingir a pasta se solta e a vÃ­tima sentirÃ¡\numa dor horrÃ­vel. Se ela falhar em um teste de Vontade\n(dif 12), a vÃ­tima nÃ£o poderÃ¡ agir por 2 turnos\ndevido a intensa dor.\nEncontrando a Flor de Isura e a Erva dos Passos,\nvocÃª pode fazer um chÃ¡ que recupera 60 pontos de\nvida. O chÃ¡ deve ser feito com Ã¡gua fervente. Ele perde\nseu efeito se nÃ£o for tomado na hora. ', 0);

