(2, 'Ataque do BÃºfalo', 'Nenhum', 'AÃ§Ã£o', 10, 'VocÃª pode fazer um ataque normal\nusando uma arma de FN 5 ou mais. Se acertar, alem do\ndano, o oponente cairÃ¡ para traz (a menos que ele seja\n2 vezes mais pesado que vocÃª).', 0),
(3, 'Ataque GiratÃ³rio', 'Nenhum', 'AÃ§Ã£o', 10, 'Este ataque que pode acertar todos os\noponentes adjacentes. FaÃ§a um ataque para cada um\ndestes oponentes.', 0),
(4, 'Ataque SimultÃ¢neo', 'Nenhum', 'AÃ§Ã£o', 20, 'FaÃ§a um ataque normal contra um oponente.\nSe acertar, todos aliados que estiverem adjacentes\nao mesmo oponente, poderÃ£o fazer um ataque\nnormal extra.', 0),
(5, 'Ataque do TrovÃ£o', 'Nenhum', 'AÃ§Ã£o', 20, 'FaÃ§a um ataque corporal com uma arma\nde FN 5 ou mais, para causar +10 pontos de dano (elÃ©trico)A vitima deve ser bem sucedida em um teste de\nForÃ§a (Dificuldade 12) ou ficarÃ¡ paralisada por uma rodada\ndevido ao choque.', 0),
(6, 'BrigÃ£o', 'Nenhum', 'Suporte', 0, 'Seu ataque de soco causa +2 de dano.', 0),
(7, 'Combate TÃ¡tico', 'Nenhum', 'ReaÃ§Ã£o', 0, 'Se vocÃª derrotar um oponente, vocÃª ganha\nimediatamente um ataque extra em qualquer oponente\nque esteja adjacente.', 0),
(8, 'Combate em Grupo', 'Nenhum', 'ReaÃ§Ã£o', 0, 'VocÃª ganha +1 nos ataques corporais\npara cada aliado que esteja em combate corporal com a\nmesma criatura que vocÃª.', 0),
(9, 'Defletor', 'Nenhum', 'Suporte', 0, 'Quando estiver usando um escudo ou\narma de duas mÃ£os, vocÃª recebe Defesa +2 contra ataques\na distÃ¢ncia.', 0),
(10, 'ForÃ§a de Combate', 'Nenhum', 'Suporte', 0, 'Todos seus ataques corporais causam +1 de\ndano para cada 2 pontos de forÃ§a que vocÃª tiver', 0),
(11, 'Golpe Devastador', 'Nenhum', 'AÃ§Ã£o', 30, 'VocÃª pode fazer um ataque corporal que\ncausa o dobro de dano, e a vÃ­tima nÃ£o poderÃ¡ agir no\nprÃ³ximo turno.', 0),
(12, 'Golpe com Escudo', 'Nenhum', 'ReaÃ§Ã£o', 0, 'Se fizer um ataque e errar, vocÃª pode fazer\num ataque extra com seu escudo que causarÃ¡ dano\nigual a sua forÃ§a. O oponente tambÃ©m deve vencer um\nteste de ForÃ§a (dif 12) ou cairÃ¡ no chÃ£o.', 0),
(13, 'Grito de Guerra', 'Nenhum', 'AÃ§Ã£o', 10, 'VocÃª pode dar um grito fervoroso que\nmotiva todos seus aliados. Eles recebem (assim como\nvocÃª) +1 em todas as rolagens atÃ© o final da batalha.\nEste bÃ´nus nÃ£o Ã© cumulativo.', 0),
(14, 'Investida Mortal', 'Nenhum', 'AÃ§Ã£o', 10, 'Em carga vocÃª pode desferir um poderoso\ngolpe. Se estiver distante do oponente, vocÃª pode\ncorrer atÃ© ele e fazer um ataque normal que causa +10\nde dano.', 0),
