(16, 'Quebra-Escudo', 'Nenhum', 'AÃ§Ã£o', 10, 'VocÃª deve fazer este ataque utilizando\numa arma pesada (FN 5 ou mais). Se acertar o ataque,\nnÃ£o causarÃ¡ dano algum no oponente, porÃ©m, seu escudo\nou armadura serÃ¡ destruÃ­do.', 0),
