(18, 'Pernas Fortes', 'Nenhum', 'Suporte', 0, 'VocÃª sempre rola 3d6 em testes de ForÃ§a\npara nÃ£o ser derrubado.', 0),
(19, 'Proteger Aliado', 'Nenhum', 'Suporte', 0, 'Sempre que seus aliados forem atacados,\nvocÃª ajudarÃ¡ com seu escudo. Se vocÃª usa um escudo\ngrande, todos aliados adjacentes a vocÃª recebem Defesa\n+1.', 0),
