(21, 'ForÃ§a de ExplosÃ£o', 'NÃ­vel 5', 'Suporte', 0, 'Todos seus ataques corporais derrubam\no inimigo no chÃ£o (menos inimigos que sejam 2 vezes\nmais pesados que vocÃª). Ele ainda pode fazer um teste\nde ForÃ§a (dif: [sua For] +4) para nÃ£o cair.\nEspecial: Se vocÃª usar qualquer habilidade que derrube\no oponente, a dificuldade do teste de ForÃ§a aumenta\nPara +4.', 0),
(22, 'Golpe Devastador 2', 'NÃ­vel 5; Golpe Devastador', 'AÃ§Ã£o', 60, 'VocÃª pode fazer um ataque corporal que\ncausa o triplo de dano, e a vÃ­tima nÃ£o poderÃ¡ agir no\nprÃ³ximo turno.', 0),
(23, 'Grito de Guerra 2', 'NÃ­vel 5; Grito de Guerra', 'AÃ§Ã£o', 10, 'VocÃª pode dar um grito fervoroso que\nmotiva todos seus aliados. Eles recebem (assim como\nvocÃª) +2 em todas as rolagens atÃ© o final da batalha.\nEste bÃ´nus nÃ£o Ã© cumulativo.', 0),
(24, 'Grito de IntimidaÃ§Ã£o', 'NÃ­vel 5; Grito de Guerra', 'AÃ§Ã£o', 10, 'VocÃª pode dar um grito para intimidar\nseus inimigos. Cada inimigo que estiver na batalha\ndeve vencer um teste de Vontade (Dif 14) ou ficarÃ¡\nparalisado por 2 turnos.', 0),
(25, 'Guerreiro de AÃ§o', 'NÃ­vel 5', 'Suporte', 0, 'O bÃ´nus de defesa por equipamento (armadura\ne escudo) pode somar atÃ© +6.', 0),
(26, 'ImplacÃ¡vel', 'NÃ­vel 5', 'Suporte', 0, 'Sempre que errar um ataque corporal,\nvocÃª causa dano igual Ã  metade do dano do ataque.', 0),
(27, 'Investida Forte', 'NÃ­vel 5', 'Suporte', 0, 'Sempre que vocÃª fizer uma investida\ncarregando um escudo, o oponente deve testar ForÃ§a\n(Dif = [sua For] +8). Se falhar, ele cairÃ¡ no chÃ£o.', 0),
(28, 'Matador de DragÃ£o', 'NÃ­vel 10', 'AÃ§Ã£o', 50, 'FaÃ§a um ataque corporal normal, se\nacertar reduza a vida do oponente pela metade.', 0),
