(3, 'Arma dos Deuses', 'Dogma (qualquer)', 'AÃ§Ã£o', 20, '', 'VocÃª pode conjurar a arma de seu deus patrono. Esta arma terÃ¡ as caracterÃ­sticas normais da arma apropriada do deus (escolha a que for mais lÃ³gica), mas sempre causarÃ¡ +10 de dano quando usada para o propÃ³sito do deus. Esta arma Ã© brilhante e coberta por runas angelicais. VocÃª pode usar normalmente esta arma mesmo que se ela for complexa. Ela desaparece apÃ³s 1 minuto (ou atÃ© o final da batalha) em um brilho de luz.', 'Se vocÃª perder a habilidade Dogma, vocÃª perde esta habilidade tambÃ©m.', '0'),
(4, 'Criar Alimento', 'Nenhum', 'AÃ§Ã£o', 10, '', 'VocÃª pode criar uma refeiÃ§Ã£o para atÃ© seis pessoas. Esta refeiÃ§Ã£o Ã© formada basicamente de pÃ£o, peixe, gelÃ©ia, vinho e Ã¡gua. VocÃª tambÃ©m pode usar esta habilidade para transformar um barril de Ã¡gua em vinho, transformar um peixe ou pÃ£o em 20, ou fazer brotar frutas em uma arvore ou planta apropriada.', 'perde esta habilidade tambÃ©m.', '0'),
