(8, 'Destruir Mortos-Vivos', 'Nenhum', 'AÃ§Ã£o', 10, '10', 'Todos Mortos-vivos que estiverem atÃ© 6 metros de vocÃª e que tiverem Mente Vazia, voltarÃ£o a ser cadÃ¡veres inanimados e nÃ£o poderÃ£o ser reanimados novamente.', '', '0'),
(9, 'Dogma: DiscÃ­pulo da Guerra', 'Nenhum', 'Suporte', 0, '0', 'VocÃª nunca pode fugir de uma luta (a menos que seja uma morte certa) e deve sempre honrar a morte de quem morreu lutando. VocÃª tem ForÃ§a +1 enquanto seguir este dogma. Se em qualquer momento vocÃª fugir de uma luta ou desonrar os mortos, vocÃª perderÃ¡ este bÃ´nus e esta habilidade, e nunca mais poderÃ¡ adquiri-la novamente.', 'VocÃª sÃ³ pode ter uma habilidade Dogma.', '0'),
