(12, 'Dogma: DiscÃ­pulo da Natureza', 'Nenhum', 'Suporte', 0, '0', 'VocÃª deve sempre respeitar a natureza (plantas e animais) e nunca deixar que outros desrespeitem. Com um teste bem sucedido de InteligÃªncia ou Vontade (Dif 6 + Von do animal) vocÃª pode se comunicar com um animal por meio de gestos e olhares. Se em qualquer momento vocÃª desrespeitar a natureza, deixar que outros o faÃ§am ou deixar de ajudar quando ela precisar, vocÃª perderÃ¡ esta habilidade, e nunca mais poderÃ¡ adquiri-la novamente.', 'VocÃª sÃ³ pode ter uma Dogma.', '0'),
(13, 'Dogma: DiscÃ­pulo da Paz', 'Nenhum', 'Suporte', 0, '0', 'VocÃª deve ser sempre trazer a paz, nunca poderÃ¡ lutar e nem deixar que outros o faÃ§a. VocÃª tem Vontade +2 enquanto seguir este dogma. Se em qualquer momento vocÃª lutar ou deixar que alguÃ©m lute, vocÃª perderÃ¡ este bÃ´nus e esta habilidade, e nunca mais poderÃ¡ adquiri-la novamente.', 'VocÃª sÃ³ pode ter uma Dogma.', '0'),
(14, 'Dogma: DiscÃ­pulo da Sabedoria', 'Nenhum', 'Suporte', 0, '0', 'VocÃª deve sempre que puder transmitir conhecimento e deve ler livros sagrados por pelo menos 2 horas por dia. VocÃª tem InteligÃªncia +1 enquanto seguir este dogma. Se em qualquer momento vocÃª desprezar a educaÃ§Ã£o ou deixar de ler os livros sagrados em um dia, vocÃª perderÃ¡ este bÃ´nus e esta habilidade, e nunca mais poderÃ¡ adquiri-la novamente.', 'VocÃª sÃ³ pode ter uma Dogma.', '0'),
(15, 'Dogma: O PanteÃ£o', 'Nenhum', 'Suporte', 0, '0', 'VocÃª deve ser sempre justo, respeitar a natureza e evitar combates desnecessÃ¡rios. DemÃ´nio morto-vivos ou espÃ­ritos malignos devem ser bem sucedidos em um teste de Vontade (Dif. 5 + sua Von) ou fugirÃ£o de medo de vocÃª (Seres sem Vontade devem testar ForÃ§a). Se em qualquer momento vocÃª for injusto com alguÃ©m, desrespeitar a natureza ou matar algum ser sem necessidade, vocÃª perderÃ¡ esta habilidade, e nunca mais poderÃ¡ adquiri-la novamente.', 'VocÃª sÃ³ pode ter uma habilidade Dogma.', '0'),
(16, 'GraÃ§a Divina', 'Nenhum', 'AÃ§Ã£o', 10, '10', 'Com seu toque, vocÃª pode fazer uma pessoa ganhar +2 na sua prÃ³xima rolagem de dado. Esta magia sÃ³ pode ser feita com um cajado.', NULL, '0'),
