(22, 'Sono', 'Esta magia sÃ³ pode ser feita com uma varinha.', 'AÃ§Ã£o', 20, '[Von do oponente] + 8', 'A vitima desta magia cairÃ¡ em um sono muito pesado e sÃ³ acordarÃ¡ apÃ³s 1 hora. A vÃ­tima sÃ³ acordarÃ¡ se receber algum dano, caso contrÃ¡rio ela continuarÃ¡ dormindo profundamente.', NULL, '0'),
(23, 'TelecinÃ©sia', 'Nenhum', 'AÃ§Ã£o', 10, 'Variada', 'VocÃª pode erguer qualquer objeto visÃ­vel com o poder de sua mente. A dificuldade varia de acordo com o peso do objeto, variando desde um objeto leve como uma arma (dif 10) atÃ© uma pessoa (dificuldade 20). Pode manter o objeto no ar enquanto estiver concentrado e focado no objeto.', NULL, '0'),
