(32, 'Criar Golem', 'NÃ­vel 5', 'AÃ§Ã£o', 60, '16', 'VocÃª pode dar vida para objetos inanimados. Estes seres criados sÃ£o chamados de Golens e podem ser feitos dos mais variados objetos, mas devem ser feito de um mesmo tipo de material (exemplo: Madeira, Metal, Pedra, Papel, etc.). Um golem se destrÃ³i apÃ³s 1 hora.', 'VocÃª deve usar o pÃ³ de uma pedra preciosa (no valor de 400 moedas) para fazer um golem de 1 metro de altura. Para cada metro a mais, vocÃª precisarÃ¡ de mais uma pedra e a dificuldade aumentarÃ¡ em +2.', '0'),
